import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import DataTable from "react-data-table-component";
import Card from "@material-ui/core/Card";
import { getUser, getNOKP, getToken, removeUserSession } from "./Utils/Common";

import MainDashboard from "./views/admin/Dashboard";
import Sidebar from "./Sidebar";
import Navbar from "./components/Navbars/AdminNavbar";
import Information from "./components/Cards/CardSettings";
import Footer from "./components/Footers/Footer";
import { data } from "jquery";
import swal from "sweetalert";
import { ResponsiveEmbed } from "react-bootstrap";
import Modal from './components/Modal/Modal';

function Profile(props) {

  const token   = getToken();
  const user    = getUser();
  const nokp    = getNOKP();

  const [include,isInclude] = useState(false);

  const [dataset, setDataSet] = useState(null);

  useEffect(async() => {

    var url = "https://toyyibpay.com/api/getBankFPX";

    const tarik   = await fetch(url);
    const data    = await tarik.json();

    for(var i = 0; i < data.length; i++){
      const item  = data[i].CODE;
      setDataSet(item);
    }
    
	}, []);
	
	const handleReceipt= (e) =>{
		// let url = 
		console.log(user);
		console.log(token);
		console.log(nokp);
		let id= '1';

		let url = btoa('nokp='+nokp+'&code=receipt'+'&id='+id);
		window.open('https://mymps.corrad.my/rp/receipt.php?'+url);
	}

	const handleReceipt2 = (e) => {
		let id= '2';
		let url = btoa('nokp='+nokp+'&code=receipt'+'&id='+id);
		window.open('https://mymps.corrad.my/rp/receipt.php?'+url);
  }
  
  const handleBill = (e) => {
    let data = [e.target.id];
    console.log(data);
    isInclude(true);
  }

  // console.log(dataset);

  return (
    <div>
      <Sidebar />
      <div className="relative md:ml-64 bg-gray-400" style={{ height: "100%" }}>
        <Navbar />
        {/* Header */}
        <div className="relative bg-gray-600 md:pt-32 pb-16 pt-12">
          <div className="px-4 md:px-10 mx-auto w-full">
            <div>
              <div className="flex flex-wrap">
                <div className="w-full  px-4">
                  <div className="relative flex flex-col min-w-0 break-words bg-white rounded mb-6 shadow-lg">
                    <div className="flex-auto p-4">
                      <div className="flex flex-wrap">
                        <div className="relative w-full pr-4 max-w-full flex-grow flex-1">
                          <h5 className="text-gray-500 uppercase font-bold text-xs">
                            Penggal Pertama
                          </h5>
                          <span className="font-semibold text-xl text-gray-800">
                            RM 1000.00
                            {
                              //Display Amount 1h
                            }
                          </span>
                        </div>
                        <div className="relative w-auto pl-4 flex-initial">
                          <div className="text-white p-3 text-center inline-flex items-center justify-center w-12 h-12 shadow-lg rounded-full bg-red-500">
                            <button type="button" onClick={handleBill}>
                              <i className="fas fa-plus"></i>
                            </button>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>

                <div className="w-full px-4">
                  <div className="relative flex flex-col min-w-0 break-words bg-white rounded mb-6  shadow-lg">
                    <div className="flex-auto p-4">
                      <div className="flex flex-wrap">
                        <div className="relative w-full pr-4 max-w-full flex-grow flex-1">
                          <h5 className="text-gray-500 uppercase font-bold text-xs">
                            Penggal Kedua
                          </h5>
                          <span className="font-semibold text-xl text-gray-800">
                            RM 205.90
                            {
                              //Display Amount 2h
                            }
                          </span>
                        </div>
                        <div className="relative w-auto pl-4 flex-initial">
                          <div className="text-white p-3 text-center inline-flex items-center justify-center w-12 h-12 shadow-lg rounded-full bg-orange-500">
                            <button type="button" onClick={handleBill}>
                            {
                              include 
                              ? <i className="fas fa-receipt"></i>
                              : <i class="fas fa-money-bill-wave"></i>
                            }
                            </button>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="px-4 md:px-10 mx-auto w-full mt-16 mb-16">
          <footer className="block mb-2">
            <div className="container mx-auto px-4">
              <hr className="mb-6 border-b-1 border-gray-300" />
              <div className="flex flex-wrap items-center md:justify-between justify-center h-full">
                <div className="w-full md:w-6/12 px-4">
                  <div className="text-sm text-gray-600 font-semibold py-3">
                    Hak Cipta Terpelihara © {new Date().getFullYear()}{" "}
                    <a
                      href="https://www.creative-tim.com"
                      className="text-gray-600 hover:text-gray-800 text-sm font-semibold py-1"
                    >
                      Majlis Perbandaran Selayang
                    </a>
                  </div>
                </div>
                <div className="w-full md:w-6/12 px-4">
                  <ul className="flex flex-wrap list-none md:justify-end  justify-center">
                    <li>
                      <a
                        href=""
                        className="text-gray-700 hover:text-gray-900 text-sm font-semibold block py-1 px-3"
                      >
                        Majlis Perbandaran Selayang
                      </a>
                    </li>
                    <li>
                      <a
                        href=""
                        className="text-gray-700 hover:text-gray-900 text-sm font-semibold block py-1 px-3"
                      >
                        Tentang MyMPS
                      </a>
                    </li>
                  </ul>
                </div>
              </div>
            </div>
          </footer>
        </div>
      </div>
    </div>
  );
}

export default Profile;
